import { useTheme } from "@emotion/react";
import { Button, styled } from "@mui/material";
import { buttonPropTypes, buttonDefaultProps } from "../utils/compoValidation";
const CustomButton = (props) => {
  const theme = useTheme();

  const StyledButton = styled(Button)(({ fullWidth, customstyles,colorType }) => ({
    background: colorType === 'primary' 
    ? theme.palette.primary.main
    : colorType === 'secondary' ,

    width: fullWidth ? "100%" : "auto",
    ...customstyles,
  }));
  const {
    startIcon,
    endIcon,
    customstyles,
    fullWidth,
    children,
    colorType,
    ...other
  } = props;
  return (
    <StyledButton
      fullWidth={fullWidth}
      startIcon={startIcon}
      endIcon={endIcon}
      colorType={colorType}

      {...other}

    >
      {children || "Sign In"}
    </StyledButton>
  );
};

CustomButton.propTypes = buttonPropTypes;
CustomButton.defaultProps = buttonDefaultProps;

export default CustomButton;
